import { Link, useNavigate } from 'react-router-dom';
import './Navbar.css';

function Navbar() {
  const navigate = useNavigate();

  // Logout function to clear the stored user data and redirect to login page
  const handleLogout = () => {
    // Clear user data (assuming tokens or username stored in localStorage)
    localStorage.removeItem('token'); // Assuming token is stored in localStorage
    localStorage.removeItem('username'); // Clear stored username if necessary

    // Redirect to login page
    navigate('/login');
  };

  return (
    <nav className="navbar">
      <h1>Issuance App</h1>
      <ul>
        <li><Link to="/">Home</Link></li>
        <li><Link to="/login">Login</Link></li>
        <li><Link to="/dashboard">Dashboard</Link></li>
        <li>
          <button className="logout-btn" onClick={handleLogout}>
            Logout
          </button>
        </li>
      </ul>
    </nav>
  );
}

export default Navbar;
